import SavingsItem from "./components/SavingsItem";

function App() {
  const savings = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <SavingsItem
        title={[0].title}
        amount={[0].amount}
        date={[0].date}
      ></SavingsItem>
      <SavingsItem
        title={[1].title}
        amount={[1].amount}
        date={[1].date}
      ></SavingsItem>
      <SavingsItem
        title={[2].title}
        amount={[2].amount}
        date={[2].date}
      ></SavingsItem>
      <SavingsItem
        title={[3].title}
        amount={[3].amount}
        date={[3].date}
      ></SavingsItem>
    </div>
  );
}

export default App;
